angular.module('calendar.templates').run(['$templateCache', function($templateCache) {$templateCache.put('static/app/date/date.controller.html','<section class="day">\n  <h2>{{day.weekday}}, {{day.monthName}} {{day.date}}</h2>\n  <p ng-if="!newAppointment">{{day.appointment || \'Nothing scheduled\'}}</p>\n  <button ng-if="!newAppointment" ng-click="edit()">Edit</button>\n  <form ng-show="!!newAppointment">\n    <input type="text" placeholder="New Appointment" ng-model="newAppointment.text" />\n    <button ng-click="cancelEdit()">Cancel</button>\n    <button ng-click="saveAppointment(newAppointment.text)">Save</button>\n  </form>\n  <button ng-click="close()">Back</button>\n</section>\n');
$templateCache.put('static/app/month/month.directive.html','<p>{{month.name}}</p>\n<ul class="month-days offset-{{month.startDay}}">\n  <li class="month-day"\n      ng-repeat="day in month.days"\n      ng-class="{\'past\': day.isInPast}"\n      ng-click="showDay(day)">\n    {{day.date}} - {{day.weekday}}\n  </li>\n</ul>\n');
$templateCache.put('static/app/root/root.controller.html','<month></month>');}]);